class Solution:
    def maximumLength(self, nums: List[int], k: int) -> int:
        n = len(nums)

        longest_end = {}
        mx = 0
        row = [0]
        for num in nums:
            longest_end[num] = longest_end.get(num, 0) + 1
            mx = max(mx, longest_end[num])
            row.append(mx)
        #print(row)
        for k2 in range(1, k + 1):
            prev = row
            longest_end = {}
            mx = 0
            row = [0]
            for i, num in enumerate(nums):
                longest_end[num] = max(prev[i], longest_end.get(num, 0)) + 1
                mx = max(mx, longest_end[num])
                row.append(mx)
            #print(row)
        return row[-1]
